import React from "react";
import { useContext } from "react";
import { gall } from "../App";
export default function Like() {
  const data = useContext(gall);
  console.log(data);
  return (
    <>
      {data.map((i) =>
        i.map((index, item) => {
          return (
            <div className="d-flex flex-row" style={{ width: "18rem" }}>
              <div>
                <img
                  className="d-flex flex-row"
                  src={index.download_url}
                  alt="Card image cap"
                />

                <h5 class="card-title">{index.author}</h5>
              </div>
            </div>
          );
        })
      )}
    </>
  );
}
